import React, { Component } from 'react';
import {Col, Row, Container} from "react-bootstrap"
import "./aboutContent.css"

export default class AboutContainer extends Component {
    render() {
        return (
            <section>
                <Container>
                    <Row>
                      <Col md="6"></Col>
                      <Col md="6"></Col>
                    </Row>
                </Container>
            </section>
        )
    }
}
